function rasterizePoint(x,y,z){

	var p,d;
	x-=playerX;
	y-=playerY;
	z-=playerZ;
	p=Math.atan2(x,z);
	d=Math.sqrt(x*x+z*z);
	x=Math.sin(p-yaw)*d;
	z=Math.cos(p-yaw)*d;
	p=Math.atan2(y,z);
	d=Math.sqrt(y*y+z*z);
	y=Math.sin(p-pitch)*d;
	z=Math.cos(p-pitch)*d;
	var rx1=-1000,ry1=1,rx2=1000,ry2=1,rx3=0,ry3=0,rx4=x,ry4=z,uc=(ry4-ry3)*(rx2-rx1)-(rx4-rx3)*(ry2-ry1);
	if(!uc) return {x:0,y:0,d:-1};
	var ua=((rx4-rx3)*(ry1-ry3)-(ry4-ry3)*(rx1-rx3))/uc;
	var ub=((rx2-rx1)*(ry1-ry3)-(ry2-ry1)*(rx1-rx3))/uc;
	if(!z)z=.000000001;
	if(ua>0&&ua<1&&ub>0&&ub<1){
		return {
			x:cx+(rx1+ua*(rx2-rx1))*scale,
			y:cy+y/z*scale,
			d:Math.sqrt(x*x+y*y+z*z)
		};
	}else{
		return {
			x:cx+(rx1+ua*(rx2-rx1))*scale,
			y:cy+y/z*scale,
			d:-1
		};
	}
}

function elevation(x,y,z){

    var dist = Math.sqrt(x*x+y*y+z*z);
    if(dist!=0 && z/dist>=-1 && z/dist <=1) return Math.acos(z / dist);
    return .00000001;
}

function sortFunction(a,b){
	return b.dist-a.dist;
}

function syncActiveShape(){
	
	activeShape.yaw=activeShape.sourceYaw+(activeShape.destYaw-activeShape.sourceYaw)*completion;
	activeShape.pitch=activeShape.sourcePitch+(activeShape.destPitch-activeShape.sourcePitch)*completion;
	activeShape.roll=activeShape.sourceRoll+(activeShape.destRoll-activeShape.sourceRoll)*completion;
	activeShape.id=activeShape.sourceId+(activeShape.destId-activeShape.sourceId)*completion;
	for(i=0;i<activeShape.polys.length;++i){
		for(j=0;j<activeShape.polys[i].verts.length;++j){
			x1=activeShape.sourcePolys[i].verts[j].x;
			y1=activeShape.sourcePolys[i].verts[j].y;
			z1=activeShape.sourcePolys[i].verts[j].z;
			x2=activeShape.destPolys[i].verts[j].x;
			y2=activeShape.destPolys[i].verts[j].y;
			z2=activeShape.destPolys[i].verts[j].z;
			activeShape.polys[i].verts[j].x=x1+(x2-x1)*completion;
			activeShape.polys[i].verts[j].y=y1+(y2-y1)*completion;
			activeShape.polys[i].verts[j].z=z1+(z2-z1)*completion;
		}
	}
}

function advanceShape(){

	currentShape=(currentShape+1)%shapes.length;
	completion=0;
	tempShape=new Shape(0,0,0,0,0,0);
	tempShape.sourceId=activeShape.id;
	//alert(activeShape.id);
	tempShape.id=activeShape.id;
	tempShape.destId=shapes[currentShape].id;
	tempShape.sourceYaw=activeShape.yaw;
	tempShape.sourcePitch=activeShape.pitch;
	tempShape.sourceRoll=activeShape.roll;
	tempShape.yaw=activeShape.yaw;
	tempShape.pitch=activeShape.pitch;
	tempShape.roll=activeShape.roll;
	tempShape.destYaw=shapes[currentShape].yaw;
	tempShape.destPitch=shapes[currentShape].pitch;
	tempShape.destRoll=shapes[currentShape].roll;
	tempShape.sourcePolys=new Array();
	tempShape.destPolys=new Array();
	for(i=0;i<shapes[currentShape].polys.length;++i){
		p1=new Polygon();
		p2=new Polygon();
		p3=new Polygon();
		for(j=0;j<shapes[currentShape].polys[i].verts.length;++j){
			t=parseInt(i*(activeShape.polys.length/shapes[currentShape].polys.length));
			if(j<activeShape.polys[t].verts.length){						
				x=activeShape.polys[t].verts[j].x;
				y=activeShape.polys[t].verts[j].y;
				z=activeShape.polys[t].verts[j].z;
			}else{
				x=activeShape.polys[0].verts[0].x;
				y=activeShape.polys[0].verts[0].y;
				z=activeShape.polys[0].verts[0].z;						
			}
			p1.verts.push(new Vertex(x,y,z));
			p2.verts.push(new Vertex(x,y,z));
			x=shapes[currentShape].polys[i].verts[j].x;
			y=shapes[currentShape].polys[i].verts[j].y;
			z=shapes[currentShape].polys[i].verts[j].z;
			p3.verts.push(new Vertex(x,y,z));
		}
		tempShape.sourcePolys.push(p1);
		tempShape.polys.push(p2);
		tempShape.destPolys.push(p3);
	}
	activeShape=tempShape;
	advanceTimer=frames+advanceInterval;
}

function doLogic(){
	
	p=Math.atan2(playerX,playerZ);
	d=Math.sqrt(playerX*playerX+playerZ*playerZ);
	d-=Math.sin(frames/50)/3.5;
	t=Math.sin(frames/160)/40;
	playerX=Math.sin(p+t)*d;
	playerZ=Math.cos(p+t)*d;
	playerY+=Math.cos(frames/80)/2.5;
	yaw=pi+p+t;
	pitch=elevation(playerX,playerZ,playerY)-pi/2;
	
	completion+=.025;
	if(completion<=1.025){
		syncActiveShape();
	}else{
		if(advanceTimer<frames) advanceShape();
	}

	activeShape.yaw+=Math.cos(frames/32)*.1;
	for(i=0;i<shapes.length;++i){
		shapes[i].yaw-=.05;
		shapes[i].yaw+=Math.cos(frames/32)*.1;
	}

	if(leftButton){
		p1=Math.atan2(playerX,playerZ)+mx/50;
		p2=elevation(playerX,playerZ,playerY)+my/50;
		if(p2<0)p2=0;
		if(p2>pi)p2=pi;
		d=Math.sqrt(playerX*playerX+playerY*playerY+playerZ*playerZ);
		playerX=Math.sin(p1)*Math.sin(p2)*d;
		playerZ=Math.cos(p1)*Math.sin(p2)*d;
		playerY=Math.cos(p2)*d;
		yaw=pi+p1;
		pitch=-pi/2+p2;
	}
	if(rightButton){
		p1=Math.atan2(playerX,playerZ);
		p2=elevation(playerX,playerZ,playerY);
		d=Math.sqrt(playerX*playerX+playerY*playerY+playerZ*playerZ)-my;
		if(d<5)d=5;
		playerX=Math.sin(p1)*Math.sin(p2)*d;
		playerZ=Math.cos(p1)*Math.sin(p2)*d;
		playerY=Math.cos(p2)*d;		
	}
	yawV/=1.5;
	pitchV/=1.5;
	mx=0;my=0;
}

function rgb(col){
	
	var r = parseInt((.5+Math.sin(col)*.5)*16);
	var g = parseInt((.5+Math.cos(col)*.5)*16);
	var b = parseInt((.5-Math.sin(col)*.5)*16);
	return "#"+r.toString(16)+g.toString(16)+b.toString(16);
}

function rgb2(col){
	
	var r = parseInt((.75+Math.sin(col)*.25)*16);
	var g = parseInt((.75+Math.cos(col)*.25)*16);
	var b = parseInt((.75-Math.sin(col)*.25)*16);
	return "#"+r.toString(16)+g.toString(16)+b.toString(16);
}

function drawShape(shape){
	
	for(j=0;j<shape.polys.length;++j){
		for(k=0;k<shape.polys[j].verts.length;++k){
			x=shape.polys[j].verts[k].x;
			y=shape.polys[j].verts[k].y;
			z=shape.polys[j].verts[k].z;
			p=Math.atan2(x,y);
			d=Math.sqrt(x*x+y*y);
			x=Math.sin(p+shape.roll)*d;
			y=Math.cos(p+shape.roll)*d;
			p=Math.atan2(y,z);
			d=Math.sqrt(y*y+z*z);
			y=shape.y+Math.sin(p+shape.pitch)*d;
			z=Math.cos(p+shape.pitch)*d;
			p=Math.atan2(x,z);
			d=Math.sqrt(x*x+z*z);
			x=shape.x+Math.sin(p+shape.yaw)*d;
			z=shape.z+Math.cos(p+shape.yaw)*d;
			point1=rasterizePoint(x,y,z);
			if(k==shape.polys[j].verts.length-1){
				x=shape.polys[j].verts[0].x;
				y=shape.polys[j].verts[0].y;
				z=shape.polys[j].verts[0].z;
			}else{
				x=shape.polys[j].verts[k+1].x;
				y=shape.polys[j].verts[k+1].y;
				z=shape.polys[j].verts[k+1].z;
			}
			p=Math.atan2(x,y);
			d=Math.sqrt(x*x+y*y);
			x=Math.sin(p+shape.roll)*d;
			y=Math.cos(p+shape.roll)*d;
			p=Math.atan2(y,z);
			d=Math.sqrt(y*y+z*z);
			y=shape.y+Math.sin(p+shape.pitch)*d;
			z=Math.cos(p+shape.pitch)*d;
			p=Math.atan2(x,z);
			d=Math.sqrt(x*x+z*z);
			x=shape.x+Math.sin(p+shape.yaw)*d;
			z=shape.z+Math.cos(p+shape.yaw)*d;
			point2=rasterizePoint(x,y,z);
			if(point1.d!=-1 && point2.d!=-1){
				/*
				ctx.strokeStyle=rgb(pi*2/shapes.length*shape.id+.000001);
				ctx.globalAlpha=.12;
				width1=350/(1+point1.d);
				width2=350/(1+point2.d);
				for(m=0;m<lineSubs;++m){
					ctx.lineWidth=width1+(width2-width1)/lineSubs*m;
					ctx.beginPath();
					x1=point1.x+(point2.x-point1.x)/lineSubs*m;
					y1=point1.y+(point2.y-point1.y)/lineSubs*m;
					x2=point1.x+(point2.x-point1.x)/lineSubs*(m+1);
					y2=point1.y+(point2.y-point1.y)/lineSubs*(m+1);
					ctx.moveTo(x1,y1);
					ctx.lineTo(x2,y2);
					ctx.closePath();
					ctx.stroke();
				}
				*/
				
				ctx.strokeStyle=rgb2(pi*2/shapes.length*shape.id+.000001);
				//ctx.strokeStyle="#fff";
				width1=100/(1+point1.d);
				width2=100/(1+point2.d);
				ctx.globalAlpha=.65;
				for(m=0;m<lineSubs;++m){
					ctx.lineWidth=width1+(width2-width1)/lineSubs*m;
					ctx.beginPath();
					x1=point1.x+(point2.x-point1.x)/lineSubs*m;
					y1=point1.y+(point2.y-point1.y)/lineSubs*m;
					x2=point1.x+(point2.x-point1.x)/lineSubs*(m+1);
					y2=point1.y+(point2.y-point1.y)/lineSubs*(m+1);
					ctx.moveTo(x1,y1);
					ctx.lineTo(x2,y2);
					ctx.closePath();
					ctx.stroke();
				}
			}
		}
	}
}

function draw(){
	
	ctx.clearRect(0,0,cx*2,cy*2);
	
	ctx.fillStyle="#42f";
	for(i=-200;i<200;i+=10){
		for(j=-200;j<200;j+=10){
			tx=i;tz=j;ty=25;
			point=rasterizePoint(tx,ty,tz);
			if(point.d!=-1){
				size=500/(1+point.d);
				d=Math.sqrt(tx*tx+tz*tz);
				a=.75-Math.pow(d/200,10)*.75;
				ctx.globalAlpha=a<0?0:a;
				ctx.fillRect(point.x-size/2,point.y-size/2,size,size);				
			}
		}
	}
	drawShape(activeShape);
}

window.addEventListener("keydown", function(e){

	chr=e.keyCode || e.charCode;
	switch(chr){
		case 37:leftkey=1;break;
		case 38:upkey=1;break;
		case 39:rightkey=1;break;
		case 40:downkey=1;break;
		case 32:
			spacekey=1;
			currentShape=(currentShape+1)%shapes.length;
			advanceShape();
			break;
		case 18:altkey=1;break;
		case 87:wkey=1;break;
		case 65:akey=1;break;
		case 83:skey=1;break;
		case 68:dkey=1;break;
		case 16:shiftkey=1;break;
		case 13:enterkey=1;break;
	}
});

window.addEventListener("keyup", function(e){

	chr=e.keyCode || e.charCode;
	switch(chr){
		case 37:leftkey=0;break;
		case 38:upkey=0;break;
		case 39:rightkey=0;break;
		case 40:downkey=0;break;
		case 32:spacekey=0;break;
		case 18:altkey=0;break;
		case 87:wkey=0;break;
		case 65:akey=0;break;
		case 83:skey=0;break;
		case 68:dkey=0;break;
		case 16:shiftkey=0;break;
		case 13:enterkey=0;break;
	}
});

function frame(){

	if(frames>100000){
		seedTimer=0;
		frames=0;
	}
	frames++;
	draw();
	doLogic();
}

function kickoff(){
	
	$("#canvas").show();
	draw();
	setInterval(frame,30);
}

initVars();
loadShapes();
$(window).load(function(){
	kickoff();
});